import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';


class App extends Component{

  constructor(props){
    super(props);
    this.state = {
      data : []
    }
  }

  componentDidMount(){
      fetch('http://localhost:8080/data')
        .then(res => res.json())
        .then(json => {
            this.setState({
              data : json
            })
        });
  }

  render(){

    var {data} = this.state;
    return(
      <div className ="App">
        <ul>
          {data.map(d => (
            <li key={d.id}>
              {d.id} | {d.country} | {d.state} | {d.confirmed} | {d.recovered} | {d.death}
            </li>
          ))};
        </ul>

  <table class="table table-striped table-dark">
  <thead>
    <tr>
      <th scope="col">Id</th>
      <th scope="col">country</th>
      <th scope="col">State</th>
      <th scope="col">Confirmed</th>
      <th scope="col">Death</th>
      <th scope="col">Recovered</th>
    </tr>
  </thead>
  <tbody>
    {data.map(d=>(
    <tr>
      <th scope="row">1</th>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
    ))};
  </tbody>
</table>
      </div>
    )
  }
}
export default App;
